h1 {
  margin: 0;
  font-size: 3em;
  font-weight: 900;
  line-height: 1.25em;
}

h1.huge {
  font-size: 7em;
}

h2 {
  margin: 0;
  font-weight: 700;
}

h5 {
  margin: 0;
  color: #aaa;
  font-size: 0.825em;
  font-weight: 900;
}

p,
li {
  color: #333;
  font-size: 0.875em;
  line-height: 1.75em;
}

.subheader {
  font-weight: 300;
  color: #aaa;
  font-size: 0.75em;
  line-height: 1.5em;
  margin-top: 12px;
}
.subheader a {
  font-size: 1em;
  text-transform: none;
  font-weight: 300;
}
.subheader a:after {
  bottom: 0px;
}

.subheader.huge {
  font-size: 1.75em;
}

a {
  text-transform: uppercase;
  text-decoration: none;
  font-weight: 900;
  font-size: 0.75em;
  color: #6EC6B1;
  line-height: 1.5em;
  transition: 0.2s;
  position: relative;
}
a:hover {
  transition: 0.2s;
  color: #49b89d;
}
a:hover:after {
  width: 100%;
  background: #49b89d;
}
a:after {
  position: absolute;
  left: 0;
  bottom: -2px;
  content: "";
  width: 0%;
  height: 2px;
  background: #6EC6B1;
  transition: 0.2s;
}

.underline {
  position: relative;
}

.mint {
  color: #6EC6B1;
}

.resume-container {
  display: flex;
  flex-direction: column;
  padding: 0px;
  width: 100vw;
  height: 100vh;
  position: relative;
  align-items: center;
  overflow-y: hidden;
}
@media (max-width: 768px) {
  .resume-container {
    padding: 12px;
  }
}
.resume-container h3,
.resume-container h4,
.resume-container p {
  margin: 0;
}
.resume-container h2 {
  padding-bottom: 6px;
  border-bottom: 1px solid #6EC6B1;
}
.resume-container h3 {
  margin-bottom: 12px;
}
.resume-container h4 {
  font-weight: 500;
}
.resume-container p,
.resume-container li {
  color: #333;
  font-size: 0.825em;
  line-height: 1.75em;
}
.resume-container .resume-wrapper {
  position: absolute;
  width: 100vw;
  height: 100vh;
  overflow-y: auto;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
}
.resume-container .resume {
  display: flex;
  flex-direction: column;
  padding: 0px;
  padding: 48px 72px;
  margin: 48px auto;
  background: #fff;
  box-shadow: 0 4px 12px rgba(51, 51, 51, 0.2);
  max-width: 768px;
  border-radius: 12px;
  flex-shrink: 0;
}
.resume-container .resume > :not(:last-child) {
  margin-bottom: 12px;
